function loadCultureFiles(name) {
    var files = ['numbers.json', 'timeZoneNames.json', 'currencies.json', 'ca-gregorian.json', 'dateFields.json'];
    var loader = ej.base.loadCldr;

    var loadCulture = function (prop) {
        var val, ajax;
        ajax = new ej.base.Ajax(location.origin + '/js/cldr-data/' + files[prop], 'GET', false);
        ajax.onSuccess = function (value) {
            val = value;
        };
        ajax.send();
        loader(JSON.parse(val));
    };

    for (var prop = 0; prop < files.length; prop++) {
        loadCulture(prop);
    }
}

document.addEventListener('DOMContentLoaded', function () {

    
    loadCultureFiles('pt');

    //ej.base.setCulture('pt');

    ej.base.setCurrencyCode('BRL');
    ej.base.enableRipple(true);

   
});

